////////////\n      //    Auth Interceptor     //\n      /////////////////////////////\n\n    var interceptor = ['$location', '$q', '$injector', function($location, $q, $injector) {\n      function success(response) {\n          return response;\n      }\n      function error(response) {\n          if(response.status === 401) {\n            console.log(\"Interceptor 401\")\n            $injector.get('$state').transitionTo('login');\n            return $q.reject(response);\n          }\n          else {\n            // individual error handling\n            console.log(\"Interceptor error...we should write these to a DB\", response.statusText)\n            // TODO server should respond with detail error texts;\n            return $q.reject(response);\n          }\n      }\n      return function(promise) {\n          return promise.then(success, error);\n      }\n    }];\n\n    $httpProvider.responseInterceptors.push(interceptor);\n\n\n      /////////////////////////////\n      // Redirects and Otherwise //\n      /////////////////////////////\n\n      // Use $urlRouterProvider to configure any redirects (when) and invalid urls (otherwise).\n      $urlRouterProvider\n\n        // The `when` method says if the url is ever the 1st param, then redirect to the 2nd param\n        // Here we are just setting up some convenience urls.\n        .when('/c?id', '/contacts/:id')\n        .when('/user/:id', '/contacts/:id')\n\n        // If the url is ever invalid, e.g. '/asdf', then redirect to '/' aka the home state\n        .otherwise('/');\n\n\n      //////////////////////////\n      // State Configurations //\n      //////////////////////////\n\n      // Use $stateProvider to configure your states.\n      $stateProvider\n\n        .state('login', {\n          url: '/login',\n          controller: 'loginController',\n          templateUrl: 'views/Login.html'\n        })\n\n        //////////\n        // Home //\n        //////////\n\n        .state(\"home\", {\n\n          // Use a url of \"/\" to set a states as the \"index\".\n          url: \"/\",\n\n          // controller: 'landingController',\n          // templateUrl: 'views/notsure.html'\n          views: {\n\n              // So this one is targeting the unnamed view within the parent state's template.\n              '': {\n                templateUrl: 'views/notsure.html',\n                controller: 'landingController'\n              },\n\n              // This one is targeting the ui-view=\"hint\" within the unnamed root, aka index.html.\n              // This shows off how you could populate *any* view within *any* ancestor state.\n              'content@home': {\n                templateUrl: 'views/landing.html'\n              }\n            }\n\n        })\n\n        ///////////\n        // About //\n        ///////////\n\n        .state('home.about', {\n          url: 'about',\n          views: {\n            'content': {\n              template: '<br><br>This is about'\n            }\n          }\n\n          // Showing off how you could return a promise from templateProvider\n          // templateProvider: ['$timeout',\n          //   function (        $timeout) {\n          //     return $timeout(function () {\n          //       return '<p class=\"lead\">UI-Router Resources</p><ul>' +\n          //                '<li><a href=\"https://github.com/angular-ui/ui-router/tree/master/sample\">Source for this Sample</a></li>' +\n          //                '<li><a href=\"https://github.com/angular-ui/ui-router\">Github Main Page</a></li>' +\n          //                '<li><a href=\"https://github.com/angular-ui/ui-router#quick-start\">Quick Start</a></li>' +\n          //                '<li><a href=\"https://github.com/angular-ui/ui-router/wiki\">In-Depth Guide</a></li>' +\n          //                '<li><a href=\"https://github.com/angular-ui/ui-router/wiki/Quick-Reference\">API Reference</a></li>' +\n          //              '</ul>';\n          //     }, 100);\n          //   }]\n        })\n\n        .state('home.query', {\n          url: 'query/new/?State&Age&Product&Distance',\n          reloadOnSearch: false,\n          views: {\n            'content': {\n              templateUrl: 'views/newQuery.html',\n              controller: \"queryController\",\n            }\n          }\n        })\n\n        // .state('home.query.results', {\n        //   url: '/results/?myParam1&myParam2'\n        // })\n\n        .state('home.campaign', {\n          url: 'Campaigns',\n          views: {\n            'content': {\n              templateUrl: 'views/campaigns.html',\n              controller: \"campaignController\"\n            }\n          }\n        })\n\n        .state('home.campaign.new', {\n          url: '/new/:campaignID',\n          views: {\n            'content@home': {\n              templateUrl: 'views/newcampaign.html',\n              controller: \"newCampaignController\"\n            }\n          }\n        })\n\n        .state('home.campaign.details', {\n          url: '/details/:campaignID',\n          views: {\n            'content@home': {\n              templateUrl: 'views/campaign-details.html',\n              controller: \"campaignControllerDetails\"\n            }\n          }\n        })\n\n        .state('home.tasks', {\n          url: 'Tasks/:taskID',\n          views: {\n            'content': {\n              templateUrl: 'views/tasks.html',\n              controller: \"taskController\"\n            }\n          }\n        })\n\n        .state('home.admin', {\n          url: 'admin/',\n          views: {\n            'content': {\n              templateUrl: 'views/admin.html',\n              controller: \"adminController\"\n            }\n          }\n        })\n\n        .state('home.timeline', {\n          url: 'timeline/',\n          views: {\n            'content': {\n              templateUrl: 'views/timeline.html',\n              controller: \"timelineController\"\n            }\n          }\n        })\n\n        .state('home.roles', {\n          url: 'roles/',\n          views: {\n            'content': {\n              templateUrl: 'views/roles.html',\n              controller: \"rolesController\"\n            }\n          }\n        })\n\n        .state('home.prospect', {\n          url: 'Prospect/:ProspectID',\n          views: {\n            'content': {\n              templateUrl: 'views/Prospect.html',\n              controller: \"prospectController\"\n            }\n          }\n        })\n\n\n    }\n  ]\n);\n\n// import {values} from './generators';\n\n\n// for (let todo of values(this.todos)) {\n//   console.log()\n// }\n\n\n// import {values} from './generators';\n\n\nvar list = [1, 2, 3, 4];\nvar res = (for (x of list) x);\n\nconsole.log(\"Res\", res)\nvar acc = '';\nfor (var x of res) {\n  acc += x;\n  console.log(\"Acc\", acc)\n}\n\nvar res = (for (x of list) x);\nconsole.log(\"Res next\", res.next(), res.next())\n\n\nfunction timeout(ms) {\n  return new Promise((resolve) => {\n    setTimeout(resolve, ms);\n  });\n}\ntimeout(1000).then(() => {\n  console.log('done');\n});\n\n\nvar evens = [2,4,6,8];\nvar odds = evens.map(v => v + 1);\nvar nums = evens.map((v, i) => v + i);\n\nconsole.log(\"Nums\", nums)\n\n//let i = 9;\n\n//console.log(i)\n\n// var huge = [1,2,3, 4]\n\n\n// var huge = []\n// var myobj = {name: \"jon\", age: \"25\"}\n// huge.push(myobj)\n//\n// for (var n of huge) {\n//   console.log(\"Huge\", n)\n// }\n//\n// for (name of Object.keys(myobj))\n//     alert(name + \": \" + myobj[name]);\n\nvar melter = (obj) =>{\n  var temp = obj\n  temp.melted = \"melted\"\n  // return obj.melted = \"melted\"\n  return temp;\n}\nlet empty = () => {};\n\n\nclass Car {\n    constructor(make) { //constructors!\n      this.make = make;\n      this.currentSpeed = 25;\n    }\n\n    printCurrentSpeed(){\n          console.log(this.make + ' is going ' + this.currentSpeed + ' mph.');\n    }\n}\n\nclass RaceCar extends Car { //inheritance\n    constructor(make, topSpeed) {\n        super(make); //call the parent constructor with super\n        this.topSpeed = topSpeed;\n    }\n\n    goFast(){\n          this.currentSpeed = this.topSpeed;\n    }\n}\n\nlet stang = new RaceCar('Mustang', 150);\nlet prius = new Car('Prius', 100)\n\nstang.printCurrentSpeed();\nstang.goFast();\nstang.printCurrentSpeed();\n\nprius.printCurrentSpeed();\n\n\nvar num = 0; //globally scoped\n\nfor (let i = 0; i < 10; i++) { //i is block scoped\n  num += i;\n  console.log('value of i in block: ' + i);\n}\n\nconsole.log('Is i defined here?: ' + (typeof i !== 'undefined')); //Is i defined here?: false\n\n\n// ARRAY COMPREHENSION\nvar customers = [\n{city: \"Seattle\", note: \"i'm gay\", name: \"Jesus\"}\n]\n\nvar results = [\nfor(c of customers)\n  if (c.city == \"Seattle\")\n    { name: c.name, age: c.age }\n]\n\nconsole.log(\"RESULTS\", customers, results)\n\n//Classes Again;\nclass Character {\n  constructor(x, y) {\n    this.x = x;\n    this.y = y;\n  }\n}\nclass Monster extends Character {\n  constructor(x, y, name) {\n    super(x, y);\n    this.name = name;\n    this.health_ = 100;\n  }\n\n  attack(character) {\n    super.attack(character);\n    // Can also be written as:\n    // super(character);\n  }\n\n  get isAlive() { return this.health_ > 0; }\n  get health() { return this.health_; }\n  set health(value) {\n    if (value < 0) throw new Error('Health must be non-negative.');\n    this.health_ = value;\n  }\n}\n\nvar myMonster = new Monster(5,1, 'arrrg');\n\nconsole.log(\"Monster\", myMonster.health)\n\nmyMonster.health = 0;\n\n'use strict';\n/*jshint esnext: true */\n\n// This module defines several useful generators,\n// not all of which are used in the Todo app.\n\n// A generator for iterating over the key/value pairs in an object.\nexport function* entries(obj) {\n  for (let key of Object.keys(obj)) {\n    yield [key, obj[key]];\n  }\n}\n\n// A generator for iterating over the keys in an object.\nexport function* keys(obj) {\n  for (let key of Object.keys(obj)) {\n    yield key;\n  }\n}\n\n// A generator that yields the first n values of an iterator.\nfunction* take(iterator, n) {\n  while (n > 0) {\n    yield iterator.next();\n    n--;\n  }\n}\n\n// A generator for iterating over the values in an object.\nexport function* values(obj) {\n  for (let key of Object.keys(obj)) {\n    yield obj[key];\n  }\n}\n\nangular.module('uiRouterSample')\n.controller('adminController', function($scope, $rootScope, $state, $alert) {\n  console.log(\"Welcome to the Admin Controller\")\n  if(!$rootScope.credentials.admin){\n    $state.go(\"home\")\n    var myAlert = $alert({title: \"Forbidden - \",\n        content: \"We're calling the cops\",\n        placement: 'top',\n        type: 'danger',\n        show: true,\n        keyboard: true,\n        duration: 3\n        // container: \"body\"\n      });\n  }\n\n})\n\nangular.module('uiRouterSample')\n.controller('campaignController', function($scope, $rootScope, $state, campaignFactory) {\n  console.log(\"Welcome from campaign controller\")\n  $scope.availableCampaigns = []\n  var fetchAll = campaignFactory.getCampaigns();\n  var displayResults = fetchAll.then(function(data){\n    console.log(\"Got...\", data.data)\n    $scope.availableCampaigns = data.data\n  })\n\n})\n\nangular.module('uiRouterSample')\n.controller('campaignControllerDetails', function($scope, $rootScope, $state, campaignFactory, $alert) {\n  console.log(\"Welcome to details from campaign controller\")\n\n  var campaignID = $rootScope.$stateParams.campaignID;\n\n  $scope.campaignDetails = {}\n\n  //campaign is at pending @ Template @ Beginning, not pending\n  //Is this always true though? What if it's at Pending to begin\n  $scope.campaignPending = false;\n\n  var getCampaign = campaignFactory.singleCampaign(campaignID)\n  var displayCampaign = getCampaign.then(function(data){\n    console.log(\"got campaign...!\", data.data)\n    $scope.campaignDetails = data.data\n  })\n  // var invalidCampaign = getCampaign.catch(function(err){\n  //   var myAlert = $alert({title: err.statusText,\n  //       content: err.data,\n  //       placement: 'top',\n  //       type: 'danger',\n  //       show: true\n  //     });\n  // })\n  //\n  // $scope.nextStatus = function(cID){\n  //   console.log(\"Taking this campaign to the next status...!\", cID)\n  //   //if we already called the DB, we can just pass the data along.\n  //   //in fact why don't we just hide the old view\n  //   $scope.campaignPending = true;\n  // }\n  //\n  // $scope.savetoPending = function(cID){\n  //   console.log(\"Saving this template to PENDING \", cID)\n  //   $state.go('home')\n  // }\n  //\n  // $scope.todoText = \"\"\n  // $scope.activities = []\n  //\n  // $scope.activities.push(\"Example Activity 1 -- Assigned to Marketing\")\n  // $scope.activities.push(\"Example Activity 2 -- Assigned to Rick\")\n  //\n  // $scope.addActivity = function(){\n  //   console.log(\"Adding activity \", $scope.todoText)\n  //   $scope.activities.push($scope.todoText)\n  //   $scope.todoText = \"\"\n  // }\n\n})\n\nangular.module('uiRouterSample')\n.factory('campaignFactory',\n function ($http) {\n    return {\n        queryResults:function (url, callback) {\n            return $http.get('/api/campaigns')\n        },\n        singleCampaign:function (paramID) {\n          console.log(\"Get campaign....#\", paramID)\n          return $http.get('http://10.1.1.118:8000/api/campaign/' + paramID)\n        },\n        thisSavedQuery: function(data){\n          //will have to pass which saved query in the future\n          return $http.get('api/thisQuery')\n        },\n        getQueries: function(){\n          return $http.get('http://10.1.1.118:8000/api/Research/list')\n        },\n        singleQuery: function(queryID){\n          return $http.get('http://10.1.1.118:8000/api/Research/' + queryID);\n        },\n        convert: function(queryID){\n          return $http.post('http://10.1.1.118:8000/api/Campaign', $.param( { QueryID : queryID } ) );\n        },\n        saveActivity: function(campaignID, activity){\n          return $http.post('http://10.1.1.118:8000/api/Campaign/'+campaignID+'/Activity', $.param(activity) );\n        },\n        getUsers:function(){\n          return $http.get('http://10.1.1.118:8000/api/users')\n        },\n        getCampaigns: function(){\n          return $http.get('http://10.1.1.118:8000/api/campaign')\n        }\n    };\n  }\n);\n\nangular.module('uiRouterSample')\n.controller('newCampaignController', function($scope, $rootScope, $state, $alert, campaignFactory, queryFactory) {\n  console.log(\"Welcome to NEW campaign controller\")\n\n\n  $scope.tableConfig = {\n    itemsPerPage: 10,\n    fillLastPage: false,\n    maxPages: 5\n  }\n\n  $scope.DeleteProspect = function(id){\n      $scope.campaignDetails.rows.forEach((a,b) => {\n        if(a.ProspectID == id){\n          a.Status ? a.Status = 0 : a.Status = 1;\n            queryFactory.updateQueryStatus($scope.selectedQuery.QueryID, id, a.Status);\n          return true;\n        }\n      })\n  }\n\n\n  $scope.campaignID;\n  $scope.campaignConverted = false;\n  $scope.convert = function(){\n    console.log(\"Converting...\");\n    campaignFactory.convert(1).then(function(data){\n      console.log(\"DONE, campaign ID \", data.data.CampaignID)\n      $scope.campaignID = data.data.CampaignID;\n      $scope.campaignConverted = true;\n    })\n  };\n\n  $scope.userList = [];\n  campaignFactory.getUsers().then(function(data){\n    console.log(\"Got all users....\", data)\n    $scope.userList = data.data.UserList;\n  }).catch(function(err){\n    // do something\n  })\n\n  $scope.savedQueries = [];\n  $scope.selectedQuery;\n  campaignFactory.getQueries().then(function(data){\n    console.log(\"Got...\", data)\n    $scope.savedQueries = data.data\n  }).catch(function(err){\n    // do something\n  })\n\n  $scope.campaignDetails = {};\n  $scope.campaignDetails.rows = [];\n  $scope.setBillGroup = (data) => {\n    // FIXME this is being fired on page init because it thinks the value\n    // is changing;\n    console.log(\"CHANGED\", $scope.selectedQuery)\n    campaignFactory.singleQuery($scope.selectedQuery.QueryID).then(function(data){\n      console.log(\"Okay got these details\", data.data)\n      $scope.campaignDetails = data.data;\n      $scope.fetched = true;\n    })\n  };\n  if($state.params.campaignID !==\"\"){\n    // console.log(\"Yes there's params\");\n    $scope.selectedQuery = {ProductID: 1, QueryID: $state.params.campaignID, Name: \"mo test\"}\n    $scope.setBillGroup();\n  }\n\n  $scope.changeState = (bleh) => {\n    $state.go('home.campaign.details', {params:'1337'})\n  };\n\n  $scope.newActivity = {};\n  $scope.savedActivites = [];\n  $scope.activityNo = 0;\n  $scope.selectedUser;\n  $scope.saveActivity = function(){\n    var campaignID = 5;\n    $scope.newActivity.StartDateTime = \"1900-01-01\";\n    $scope.newActivity.CompletionDateTime = '2014-06-20';\n    $scope.newActivity.AssignedID = $scope.selectedUser.UserID;\n    console.log(\"SAVING....\", $scope.newActivity);\n    var save = campaignFactory.saveActivity(campaignID, $scope.newActivity);\n    save.catch(function(err){\n      var myAlert = $alert({title: err.statusText.toString(),\n          content: err.data.Message,\n          placement: 'top',\n          type: 'danger',\n          show: true,\n          duration: 3\n        });\n    });\n    save.then(function(result){\n      // do something;\n    })\n    $scope.savedActivites.push($scope.newActivity);\n    $scope.activityNo++;\n    $scope.newActivity = {};\n  };\n\n})\n\nangular.module('uiRouterSample')\n.controller('loginController', function($scope, $rootScope, Privilege, $cookies, $alert, $http) {\n  console.log(\"Controller loaded\")\n  $rootScope.loggedIn = $rootScope.loggedIn || false;\n  $scope.creds = {};\n  $scope.creds.userid = $cookies.userid;\n  // $rootScope.credentials = {}\n  // decided to define this in app.run\n